import React from 'react';
import logo from './open.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1> Tracer </h1>
        <img src="https://images.vexels.com/media/users/3/193280/isolated/preview/8239ac53cb85b93a6786e3c5e665acfa-covid-19-symptom-girl-headache-by-vexels.png" />
        </header>
    </div>
  );
}

export default App;
